import React, { Component } from 'react'
import Styled from "../style/styled"

export default class ConfirmDelete extends Component {
    constructor(props){
        super(props)
        this.state={
            confirm:"hidden",
            delete:"visibile"
        }
    }
    render() {
        return (
            <Styled.ConfirmDelete onClick={()=>this.props.delete(this.props.item)}>
                Delete
            </Styled.ConfirmDelete>
        )
    }
}
